import React from 'react';
import { Link } from 'react-router-dom';
import HomeReview from '../HomeReview/HomeReview';
import "./"

const Home = () => {
    
    return (
        <div >
         <h1>1st section</h1>
         <HomeReview></HomeReview>
         <Link to="/reviews"><button className='review-btn' >See More Review</button></Link>
        </div>
    );
};

export default Home;
